INSERT INTO `tips` VALUES (1,1,7,'ngon ko ta',NULL,NULL,'2017-10-01 11:23:42','2017-10-01 11:23:42'),(2,1,5,'Ngon lm',NULL,NULL,'2017-10-01 12:22:55','2017-10-01 12:22:55'),(3,2,5,'If you like Japanese BBQ this is the place to go',NULL,NULL,'2017-10-01 12:25:19','2017-10-01 12:25:19'),(4,1,5,'Yes1',NULL,'2017-11-27 02:01:29','2017-10-01 12:25:25','2017-11-27 02:01:29'),(5,4,5,'Go to the top floor, the 2nd floor is a different restaurant. This is the best Japanese bbq I\'ve had since Japan. The beef tongue and harami is amazing.',NULL,NULL,'2017-10-01 12:29:47','2018-02-04 13:53:50'),(6,1,5,'Oke',NULL,NULL,'2017-10-01 12:30:04','2017-10-01 12:30:04'),(7,2,3,'McDonald\'s is crappy fast food but addicting',NULL,NULL,'2017-10-02 02:10:45','2017-10-02 02:10:45'),(8,1,1,'Mn ngon khng',NULL,'2017-10-23 01:09:53','2017-10-02 10:03:12','2017-10-23 01:09:53'),(9,5,26,'Ngon qu',NULL,NULL,'2017-10-04 14:54:51','2017-10-04 14:54:51'),(10,3,26,'O day oc xo rau mung ngon lm',NULL,NULL,'2017-10-04 14:55:29','2017-10-04 14:55:29'),(11,3,26,'Ok ti  s n',NULL,NULL,'2017-10-04 14:55:52','2017-10-04 14:55:52'),(12,4,27,'Great value and easy to walk to Japanese district. Not as close to the main area, but only a few min can ride.',NULL,NULL,'2017-10-04 18:57:01','2017-10-04 18:57:01'),(13,3,26,'@duy chieu di an o day nha',NULL,NULL,'2017-10-05 04:35:45','2017-10-05 04:35:45'),(14,3,3,'Ok',NULL,NULL,'2017-10-05 04:42:08','2017-10-05 04:42:08'),(15,1,26,'Oke a ra lm vi chai',NULL,NULL,'2017-10-05 11:22:23','2017-10-05 11:22:23'),(16,2,33,'I haven\'t been here in 15 years but from what I can remember it was awesome. The food was great, the ambiance impeccable, and the price was incredibly cheap. Highly recommend it -- if it\'s the same place that is...',NULL,NULL,'2017-10-06 11:26:54','2017-10-06 11:26:54'),(17,2,35,'Hike the volcano and cook an egg using the heat from volcano',NULL,NULL,'2017-10-07 08:06:33','2017-10-07 08:06:33'),(18,2,34,'Great coffee place in the heart of Saigon. They don\'t have cafe sua da though!',NULL,NULL,'2017-10-07 09:39:08','2017-10-07 09:39:08'),(19,4,38,'Nice intro to Indonesian food although more Americanized and more on the expensive side being in Seminyak. The wagyu beef sticks were good and the salsa was the spiciest salsa I\'ve ever had.',NULL,NULL,'2017-10-07 14:22:30','2017-10-07 14:22:30'),(20,1,36,'Ca phe dy uong ngon qua',NULL,NULL,'2017-10-08 10:00:05','2017-10-08 10:00:05'),(21,4,41,'I\'m personally not a fan of monkeys, but it\'s a quick 30min stop in Ubud and cost 50k per person. Lots of monkeys and good photo ops.',NULL,NULL,'2017-10-09 04:31:44','2017-10-09 04:31:44'),(22,4,43,'A knock off of Halal Guys but cheap and convenient. Not bad.',NULL,NULL,'2017-10-09 04:33:13','2017-10-09 04:33:13'),(23,4,44,'Good for photos and convenient as next to Ubud market.',NULL,NULL,'2017-10-09 06:10:46','2017-10-09 06:10:46'),(24,4,45,'Very cool for photos. Stop by Ubud and then go here.',NULL,NULL,'2017-10-09 08:34:27','2017-10-09 08:34:27'),(25,4,47,'The highlight of the trip. Amazing like tomb raider end after a 20 min walk. Bring towels and a change of clothes just in case it rains. And flip flops and sneakers for the walking in the stream and walking down some steep and slipper steps respectively. A bit out of the way but not many tourists so we had the waterfall all to ourselves.',NULL,NULL,'2017-10-09 10:02:09','2017-10-09 10:02:09'),(26,4,48,'Only had breakfast here but it was clean eats. The oatmeal and blueberry and yogurt was super clean.',NULL,NULL,'2017-10-09 12:17:46','2017-10-09 12:17:46'),(27,4,51,'Supposedly some amazing bbq',NULL,NULL,'2017-10-10 05:23:30','2017-10-10 05:23:30'),(28,4,1,'cactus ngon qua',NULL,NULL,'2017-10-14 10:35:30','2017-10-14 10:35:30'),(29,1,1,'Hi ngon lm a jacques',NULL,NULL,'2017-10-14 10:39:41','2017-10-14 10:39:41'),(30,1,5,'Thc n  y ngon lm ?.',NULL,NULL,'2017-10-14 10:43:12','2017-11-16 06:17:11'),(31,4,1,'???delicious',NULL,NULL,'2017-10-14 10:44:09','2017-10-14 10:44:09'),(32,4,52,'Clean place, more traditional Vietnamese food. But nothing jumped out as really good. Has it where you wrap the food in rice wraps. Locals like this place.',NULL,NULL,'2017-10-14 11:46:08','2017-10-14 11:46:08'),(33,4,63,'Where most all my friends live because great combination of location price and nice. Has a gym and decent cafe and pool. Good Airbnb spot. 7 min taxi or uber ride.',NULL,NULL,'2017-10-14 17:07:04','2017-10-14 17:07:04'),(34,4,64,'I used to live here. Probably the best Airbnb as long as you can stay in floor 14 or less. Rooftop bar and club beneath. The only place I know one can Airbnb and take an elevator to the club. Good cheap restaurant below and great chicken spot across the street. Gym sucks and pool is small but on the roof.',NULL,NULL,'2017-10-14 17:11:21','2018-01-15 07:01:47'),(35,4,65,'Great location, but I personally like le meridien which is more modern and better priced, but you need a 5 min taxi ride to spots. Walking in Saigon is overrated in the heat anyway.',NULL,NULL,'2017-10-14 17:13:41','2017-10-14 17:13:41'),(36,4,66,'Great bang for the buck for a modern hotel. Decent location as walking distance to backpacking street.',NULL,NULL,'2017-10-14 17:14:29','2017-10-14 17:14:29'),(37,4,67,'I personally have only visited but not stayed here, but one of my top recommendations for new people visiting the city. It has the best location of all the hotels walking wise. Has a nice movie theater inside and good food and coffee nearby. The best mall in Saigon is across the street which has great food courts.',NULL,NULL,'2017-10-14 17:16:59','2018-01-15 07:04:56'),(38,4,68,'One of the nicest hotels and good location.',NULL,NULL,'2017-10-14 17:19:34','2017-10-14 17:19:34'),(39,4,69,'One of my favorite rooftop bars. Nice mixed crowd of expats and well to do locals. What\'s nice is you can go clubbing one level down as well. You can do bottle service with table res or just get drinks at the bar.',NULL,NULL,'2017-10-14 17:23:23','2017-10-14 17:23:23'),(40,4,70,'Decent club, but what\'s unique is that you can do both club and rooftop bar at the same spot. Glow Bar is right upstairs.',NULL,NULL,'2017-10-14 17:24:47','2017-10-14 17:24:47'),(41,4,71,'Maybe the nicest hotel in Saigon. Can\'t beat the location. I haven\'t stayed here though, just heard great things and have drinken at the bar which is a popular spot.',NULL,NULL,'2017-10-14 17:26:47','2017-10-14 17:26:47'),(42,4,72,'There are a few of these around town, but they have a Bac Xiu Da that\'s so unique and is my fave Vietnamese coffee. It has a hint of coconut.',NULL,NULL,'2017-10-14 17:37:33','2017-10-14 17:37:33'),(43,4,31,'I live here everyday because of my work and gym are here. It has the most popular clothing shop: Zara, H&M, Pull & Bear. Other than that, nothing unique about the mall. I do like Kohaku Sushi, Pepper Lunch, and Kichi Kichi (conveyor belt hot pot). Also, Pho 24 is not bad - one of weekly stops.',NULL,NULL,'2017-10-14 17:43:11','2017-10-14 17:43:11'),(44,4,73,'My favorite Pho in the city. It\'s like in and out for me, first I thought it was overrated, then I started missing it each day that passed. Do not confuse this with the chain Pho Ong Hung which I assume tried to ride off of this one\'s success. I also like this one better than the famous Pho Hoa on Pasteur.',NULL,NULL,'2017-10-14 17:49:57','2017-10-14 17:49:57'),(45,4,74,'Not bad Pho, but a bit overrated as it\'s ridden on its fame and IMHO its lost a step. I like Pho Hung on nguyen trai much better.',NULL,NULL,'2017-10-14 17:52:15','2017-10-14 17:52:15'),(46,4,53,'This place is famous for its rice cooked in a clay pot. It was cool seeing them break it and catch it, but I can\'t say I love crispy rice enough to go to a spot. I had to pigeon which wasn\'t bad. Very traditional Vietnamese spot so meh for me.',NULL,NULL,'2017-10-14 17:54:51','2017-10-14 17:54:51'),(47,4,20,'One of two cab companies you can trust in terms of meter. Be careful on route and directions though - sometimes they play dumb if they don\'t know the exact address and they know you\'re a foreigner. Although I trust Mai Linh more then Vinasun.',NULL,NULL,'2017-10-15 06:10:54','2017-10-15 06:10:54'),(48,4,19,'The only Vegas club style club in HCMC. Cool dancers from the ceiling and on a busy weekend, can get 800 plus people. Definitely the biggest club, but lately I haven\'t been a fan of their pricing as they don\'t have any $2M bottles. And to get a sit down table it\'s usually 2 bottle minimum ($6M+).',NULL,NULL,'2017-10-16 09:29:15','2017-10-16 09:29:15'),(49,4,76,'One of my favorite restaurants here. It\'s Japanese Pizza with all organic farms they own - yeah I know, sounds crazy to eat that in VN, but it\'s amazing.  The Burrata cheese melted over the pizza is one of a kind and the four cheese with honey is great. I also get the Japanese Carbonara pasta once in awhile.',NULL,NULL,'2017-10-16 18:44:11','2017-10-16 18:44:11'),(50,4,77,'I heard the Sushi here is amazing, but I haven\'t tried it yet.  $100-$150 per person, but it\'s sushi served one at a time style with now soy sauce dipping.  There\'s actually a large Japanese population here so lots of great Japanese food.',NULL,NULL,'2017-10-16 18:45:08','2017-10-16 18:45:08'),(51,4,78,'Supposed to be the best steakhouse in town.  It\'s expensive for Vietnam ($75 per steak I think), but everyone says its worth it and it\'s always packed.',NULL,NULL,'2017-10-16 18:50:20','2017-10-16 18:50:20'),(52,4,79,'A good stop for a variety of food from Vietnam. They basically took all the women who ran the street carts across Vietnam and put them in one restaurant.  Great spot to see all the food cart style being cooked at different stations, and then sit down at a clean place. No AC though so rougher on a hot day.',NULL,NULL,'2017-10-16 18:52:12','2017-10-16 18:52:12'),(53,4,80,'One of the solid, clean Viet spots, but very popular now, it\'s #1 on trip advisor. But good food, great prices, Vietnam Indochina style ambiance. Try to sit on the roof unless you want AC.  Recommend making reservations.',NULL,NULL,'2017-10-16 18:53:56','2017-10-16 18:53:56'),(54,4,76,'Reservations a must. You can book online at this location or Ben Thanh one which is nicer, but not the original.',NULL,NULL,'2017-10-16 18:55:07','2017-10-16 18:55:07'),(55,4,81,'Snails! This place is famous with the locals, in what use to be where the Vietnamese Mafia area. It\'s safe now, but rumor is they still go to this spot for good snails.',NULL,NULL,'2017-10-16 18:59:16','2017-10-16 18:59:16'),(56,4,82,'Great Ramen spot for $7. All the local Japanese guys go here.  What\'s even cooler is it\'s in a Japanese secret alley way.',NULL,NULL,'2017-10-16 18:59:48','2017-10-16 18:59:48'),(57,4,83,'Amazing Bun Cha Hanoi, really flavorful and tucked in an alley way.  Secret local spot.',NULL,NULL,'2017-10-16 19:00:41','2017-10-16 19:00:41'),(58,4,84,'Anthony Bourdain went here and I\'ve been here a few times. I actually think it\'s gotten a little oily, but people still love this spot.  It\'s near Com Tam Bui Sai Gon so you can hit 2 for 1.',NULL,NULL,'2017-10-16 19:02:32','2017-10-16 19:02:32'),(59,4,85,'My favorite Com Tam place, but it\'s best to go during busy hours because the turnover on the meat is good and you get fresh off the grill. Get with the egg. Then do a stop at Banh Xeo 46A nearby.',NULL,NULL,'2017-10-16 19:03:42','2017-10-16 19:03:42'),(60,4,86,'On many people\'s rotation, great chicken and rice spot and super cheap.  Love their duck and the rice, something about it soaked in chicken broth.',NULL,NULL,'2017-10-16 19:05:30','2017-10-16 19:05:30'),(61,4,87,'One of the best burgers in town. Kind of like in and out, basic but solid. I hit this place up once or twice a month.',NULL,NULL,'2017-10-16 19:06:52','2017-10-16 19:06:52'),(62,4,1,'Super popular spot, northern food. Haven\'t tried it yet, ignore my prior post :)',NULL,NULL,'2017-10-16 19:17:29','2017-10-16 19:17:29'),(63,4,88,'I heard it\'s a really cool restaurant on the river. A little pricier, but it\'s in a nice area where all the celebrities live.',NULL,NULL,'2017-10-16 19:18:13','2017-10-16 19:18:13'),(64,4,89,'One of the best brunches I\'ve had around the world. On top of the roof with a beautiful city, its 1.7M (~$75) for an amazing brunch with all you can eat lobster, truffle risotto, wagyu beef, unlimited Champagne, and drinks. Tough to beat!',NULL,NULL,'2017-10-16 19:19:40','2017-10-16 19:19:40'),(65,4,90,'An interesting look at the Vietnam war from Vietnam\'s perspective. Some graphic photos though so I wouldn\'t think it\'s kid friendly.',NULL,NULL,'2017-10-16 19:21:12','2017-10-16 19:21:12'),(66,4,91,'The nicest mall in Saigon and represents the future. Good food courts on the bottom floor (Korean style) and a Vietnamese and Japanese food court on floor 5. There\'s also a cool cafe where you can sit inside bird cage like spots (Cafe Terrace).',NULL,NULL,'2017-10-16 19:22:57','2017-10-16 19:22:57'),(67,4,92,'Not a fan of this market bc of the constant pestering and nothing I really want here, although I heard there is really good food. Big tourist destination.  I like the night market here though.',NULL,NULL,'2017-10-16 19:24:23','2017-10-16 19:24:23'),(68,1,2,'???????????',NULL,'2017-12-23 02:35:07','2017-10-18 08:26:46','2017-12-23 02:35:07'),(69,2,19,'Currently the hottest club in Saigon',NULL,NULL,'2017-10-19 14:03:57','2017-10-19 14:03:57'),(70,4,34,'Cool coffee spot, cool ambiance and scene. But it\'s 3 flights of stairs up so be ready for a hike!',NULL,NULL,'2017-10-20 07:16:58','2017-12-26 04:21:39'),(71,1,94,'Ca ph y ung rt ngon ???????? ',NULL,NULL,'2017-10-21 07:11:43','2017-11-05 16:46:59'),(72,2,58,'Good spot to hang out with decent drinks. Usually picks up after midnight. \nOne thing to be wary of is there are a lot of low end expats.',NULL,NULL,'2017-10-21 11:26:59','2017-10-21 11:26:59'),(73,2,96,'Great service, reasonable price and sushi not too bad.',NULL,NULL,'2017-10-21 11:46:40','2017-10-21 11:46:40'),(74,2,101,'Currently the best shopping mall in Vietnam. Got decent food choices on the top and basement floors.',NULL,NULL,'2017-10-22 03:00:37','2017-10-22 03:00:37'),(75,2,102,'Pretty much a family spot. Food is average but great for kids. Equipped with playground and sand lot for kids to play.',NULL,NULL,'2017-10-22 03:04:44','2017-10-22 03:04:44'),(76,4,103,'The lounge spot to go from 10pm-12am before going to the club. Relatively high end for Vietnam and super busy Thurs-Sat. I recommend getting reserving a table and buying a bottle on busier days. You can order individual drinks at the bar. The truffle gyoza is pretty good here. Actually, most appetizers are pretty good here.',NULL,NULL,'2017-10-22 18:11:37','2017-10-22 18:11:37'),(77,4,106,'Very cool spot. Small, intimate, good music - great shisha. The local celebs like this spot.',NULL,NULL,'2017-10-22 18:47:23','2017-10-22 18:47:23'),(78,4,108,'I\'ve only tried the fish tacos, but they\'re solid.',NULL,NULL,'2017-10-22 18:53:53','2017-10-22 18:53:53'),(79,2,110,'cm vn phng  y cng tm n,',NULL,NULL,'2017-10-27 21:26:47','2017-10-27 21:26:47'),(80,3,72,'Heloo',NULL,NULL,'2017-11-01 07:46:32','2017-11-01 07:46:32'),(81,3,1,'Qun y ngon  anh. Gi cng ok',NULL,NULL,'2017-11-01 07:52:20','2017-11-01 07:52:20'),(82,5,111,'Tr sa y ngon lm',NULL,NULL,'2017-11-01 14:53:07','2017-11-01 14:53:07'),(83,3,111,'Hovjvj hcjv',NULL,NULL,'2017-11-03 05:40:08','2017-11-03 05:40:43'),(84,3,111,'Rrrr',NULL,'2017-11-03 05:40:36','2017-11-03 05:40:26','2017-11-03 05:40:36'),(85,1,90,'Ngon lm a jacks',NULL,'2017-11-03 09:10:06','2017-11-03 09:09:43','2017-11-03 09:10:06'),(86,4,123,'The best chicken I\'ve ever had, for $3. Melts in your mouth, this place lives up to the Michelin star hype.',NULL,NULL,'2017-11-04 12:30:54','2017-11-04 12:30:54'),(87,4,30,'Best food court ever at the top of mall. Tons of great Thai food, for $1-3 a dish so you can try a few things. This place is amazing and I always come here when I come to Bangkok.',NULL,NULL,'2017-11-04 12:33:04','2017-11-04 12:33:04'),(88,4,118,'I recommend the hip hop room if you can get a table there.',NULL,NULL,'2017-11-07 12:32:19','2017-11-07 12:32:19'),(89,2,67,'I would agree. It\'s  really close to everything and not too pricey.',NULL,NULL,'2017-11-08 08:03:13','2017-11-08 08:03:13'),(90,4,116,'Could be a cool spot, but it wasn\'t busy when we went there. I would have prefered to hang out at the bar below!',NULL,NULL,'2017-11-10 11:35:53','2017-11-10 11:35:53'),(91,4,129,'The theaters are nicer than the states IMHO and way cheaper. I recommend premium show for big comfy seats! ',NULL,NULL,'2017-11-10 12:00:44','2017-11-10 12:00:44'),(92,4,131,'This and Lincoln Square is the place where everyone hangs out in Bellevue for shopping, happy hour, food, and going out.',NULL,NULL,'2017-11-12 16:34:01','2017-11-12 16:34:01'),(93,4,132,'Good place to play pool and hang out at night, but it\'s pricey.',NULL,NULL,'2017-11-12 16:34:55','2017-11-12 16:34:55'),(94,4,133,'My buddy\'s bar, this is the closest thing to a house party spot. Typically old school hip hop music. Good place to prefunk and if it gets crowded in a good way you got yourself a good spot or if its crowded in a bad way you can walk to other bars.',NULL,NULL,'2017-11-12 16:36:30','2017-11-12 16:36:30'),(95,4,134,'Cheap, clean, and you can bike or take a quick taxi into town.',NULL,NULL,'2017-11-12 16:37:43','2017-11-12 16:37:43'),(96,4,136,'If you\'re here on a Sunday, this is a must do. Thousands of stalls and everyone in town is here shopping and eating.',NULL,NULL,'2017-11-12 16:41:38','2017-11-12 16:41:38'),(97,4,137,'Hands down my favorite burger (low to medium end) ever. It\'s grown on me like a weed!',NULL,NULL,'2017-11-12 16:45:08','2017-11-12 16:45:08'),(98,3,2,'pi za o day rat ngon duy di an thu di',NULL,NULL,'2017-11-13 11:19:39','2017-11-13 11:19:39'),(99,2,144,'One of the better Japanese Italian restaurants in Saigon',NULL,NULL,'2017-11-15 14:11: