igon',NULL,NULL,'2017-12-09 22:43:17','2017-12-09 22:43:17'),(126,2,99,'My favorite vegetarian restaurant in Saigon. A bit of Thai flavor that packs an extra punch.',NULL,NULL,'2017-12-10 11:11:18','2017-12-10 11:11:18'),(127,2,206,'Great place to bring your kids. \nEquipped with place house and also has a kid\'s menu. Food is average though.',NULL,NULL,'2017-12-17 13:36:11','2017-12-17 14:41:26'),(128,2,208,'Fusion Vietnamese. I know the owner and he\'s done a good job with presentation of the food. It\'s also a really posh place an great for drinks too.',NULL,NULL,'2017-12-20 01:37:16','2017-12-20 01:37:16'),(129,2,209,'Love this place and highly recommend it. Awesome Local Hawaiian food',NULL,NULL,'2017-12-20 01:50:15','2017-12-20 01:50:15'),(130,2,210,'Great trail for hiking',NULL,NULL,'2017-12-20 01:54:18','2017-12-20 01:54:18'),(131,2,211,'Good fusion sushi. I\'m friends with Van the owner.',NULL,NULL,'2017-12-20 13:57:48','2017-12-20 13:57:48'),(132,4,2,'One of my favorite restaurants in HCMC and I always people new in town here. Unique to Vietnam, good quality food, air conditioning, affordable. I highly recommend the four cheese pizza (comes with honey) and any of the pizzas with the burrata cheese. It opens up like a flower over the pizza - amazing. The Japanese carbonera pasta is also a crowd favorite.',NULL,NULL,'2017-12-21 07:26:53','2017-12-21 07:26:53'),(133,4,213,'I came here on a motorcycle food tour. The Tour was amazing, but up here is just a nice view. Not much to see.  There are better destinations.',NULL,NULL,'2017-12-21 07:32:06','2017-12-21 07:32:06'),(134,4,214,'Must see if never been to Da Nang. Cool walk up to the top and you can also see all the Marble carving spots along the road.',NULL,NULL,'2017-12-21 07:33:51','2017-12-21 07:33:51'),(135,4,215,'The 2nd most beautiful beach I\'ve ever been to. Worth going, not many people. You park in a neighborhood and walk on a path through some houses to get there. First time I went, there was just two of us, a photographer and two models.',NULL,NULL,'2017-12-21 08:15:06','2017-12-21 08:15:06'),(136,4,215,'The 2nd most beautiful beach I\'ve ever been to. You have to park in a neighborhood and walk through a path between houses to get to it. There was only 5 people on the beach total - 3 of them doing a photoshoot because of how amazing it is.',NULL,'2017-12-21 08:17:05','2017-12-21 08:16:36','2017-12-21 08:17:05'),(137,4,216,'A must do! The pancakes topped with Macadamia nut pancakes is amazing!! I recommend going to Lanikai and then stopping by here after or before since they\'re both on the other side of the island.',NULL,NULL,'2017-12-21 08:19:13','2017-12-21 08:19:13'),(138,4,218,'I stayed here when it was a JW Marriott. It\'s a bit away from downtown, but the property is amazing. They had stingrays floating in ponds nearby and a private beach .',NULL,NULL,'2017-12-21 08:24:54','2017-12-21 08:24:54'),(139,4,220,'Great location, but I don\'t like the old style hotel with old creepy paintings. Expensive hotel, but you\'re paying for the location.',NULL,NULL,'2017-12-21 08:28:07','2017-12-21 08:28:07'),(140,1,194,'200$',NULL,NULL,'2017-12-22 03:57:36','2017-12-22 03:57:36'),(141,1,110,'3123',NULL,NULL,'2017-12-22 06:24:37','2017-12-22 06:24:37'),(142,19,1,'qun ngon v gi tt',NULL,'2017-12-22 06:28:39','2017-12-22 06:28:32','2017-12-22 06:28:39'),(143,1,2,'Piza  y n ngon vi hp khu v lm cho 5* ',NULL,NULL,'2017-12-23 02:35:32','2017-12-23 02:35:32'),(144,1,2,'',NULL,NULL,'2017-12-23 02:35:56','2017-12-23 02:35:56'),(145,1,2,'Dvbvv',NULL,'2017-12-23 02:36:43','2017-12-23 02:36:18','2017-12-23 02:36:43'),(146,1,2,'Vgghhhb\nHbb\nHh\nG\n\nG',NULL,'2017-12-23 02:36:41','2017-12-23 02:36:29','2017-12-23 02:36:41'),(147,3,230,'Dimsum ngon lm',NULL,NULL,'2017-12-24 05:45:41','2017-12-24 05:45:41'),(148,2,235,'Definitely worth checking out. A bit of zoo with many backpackers. You can sit outside, drink a beer and people watch.',NULL,NULL,'2017-12-24 08:05:57','2017-12-24 08:05:57'),(149,2,236,'D5 and parts of D6 are China Town. Many Chinese shops/restaurants in this area.',NULL,NULL,'2017-12-24 08:07:46','2017-12-24 08:07:46'),(150,2,75,'One of two taxi services that are reputable. Other one is Mai Linh.',NULL,NULL,'2017-12-25 08:30:18','2017-12-25 08:30:18'),(151,4,239,'A must do at night. I even recommend grabbing food or a drink on the street and watching the crowds. The lanterns are cool too, even letting them go on to the river.',NULL,NULL,'2017-12-25 12:38:17','2017-12-25 12:38:17'),(152,4,112,'Try the bac xiu da. It\'s a cafe sua da with a hint of coconut - my favorite and unique to this chain.',NULL,NULL,'2017-12-25 22:43:48','2017-12-25 22:43:48'),(153,4,113,'Probably the best Thai restaurant in Saigon. The yellow curry with chicken is my favorite dish here - I don\'t usually like curry!',NULL,NULL,'2017-12-25 22:46:17','2017-12-25 22:46:17'),(154,4,147,'This is open late so you can go here after the club and get some decent ramen and gyoza combo for all under $5.',NULL,NULL,'2017-12-25 22:47:21','2017-12-25 22:47:21'),(155,4,159,'This is the best hu tieu I\'ve ever had. Start with the dry version (more flavor), then if you\'re hungry follow-up that up with the soup version. Open late so great after hours.',NULL,NULL,'2017-12-25 22:48:51','2017-12-25 22:48:51'),(156,4,233,'Really cool speakeasy where you go for drinks by giving a password and walking through the meat locker. The sandwiches are pretty good too.',NULL,NULL,'2017-12-25 23:02:15','2017-12-25 23:02:15'),(157,4,24,'A favorite among expats and tourists, I recommend going here on Tuesday\'s (Ladies night) and booking a table in the hip hop room. Relatively diverse crowd.',NULL,NULL,'2017-12-25 23:03:27','2017-12-25 23:03:27'),(158,4,144,'I\'ve only been here for drinks, but small under the radar Japanese bar to grab some whiskey.',NULL,NULL,'2017-12-25 23:04:59','2017-12-25 23:04:59'),(159,4,56,'One of the newest rooftop bars. It\'s a really nice build out - lounge like with a DJ. Cool scene of what could be, but the crowd isn\'t there yet for me. Right next to M Gallery so you can check out that rooftop bar as well.',NULL,NULL,'2017-12-25 23:07:35','2017-12-25 23:07:35'),(160,4,240,'The new XOXO, more hip hop electro pop spot. Bottle service and reservation only. Cool spot to drink, shisha, and do balloons. Ran by the old Penthouse group which was one the best spots back in the day.',NULL,NULL,'2017-12-25 23:55:04','2017-12-25 23:55:04'),(161,4,241,'Stopped by here on the bike tour. Nice spot with a great view of the city. Would recommend stopping by when touring.',NULL,NULL,'2017-12-26 00:37:25','2017-12-26 00:37:25'),(162,4,242,'Ok rooftop bar, but not many other options. Seems like the main club in Da Nang.',NULL,NULL,'2017-12-26 01:14:16','2017-12-26 01:14:16'),(163,4,243,'Nightlife in Da Nang seems limited, but this spot is ok. Found it walking and seemed like lots of people drink here and hang out.',NULL,NULL,'2017-12-26 01:15:10','2017-12-26 01:15:10'),(164,4,185,'The place to drink, hang out by the beach, especially at night. Some days are much busier than others. Surprisingly has good Indian food. I\'d also go here during the day to eat, relax, and hang out on the beach too.',NULL,NULL,'2017-12-26 01:28:31','2017-12-26 01:28:31'),(165,4,244,'I love the lounge in Saigon, so looking forward to checking this one out.',NULL,NULL,'2017-12-26 01:54:29','2017-12-26 01:54:29'),(166,4,245,'Probably my favorite food spot in Nha Trang. Traditional food outside, with lots stations where they cook and good quality. Similar to Nga Hang Ngon in HCMC.',NULL,NULL,'2017-12-26 02:16:05','2017-12-26 02:16:05'),(167,4,248,'Similar to Ben Thanh market, minimal bargaining. Optional place to check out more clothes like Nike and Adidas type goods, fake, but good quality.',NULL,NULL,'2017-12-26 03:48:33','2017-12-26 03:48:33'),(168,4,256,'A great rooftop bar. A long line some times to get up though.',NULL,NULL,'2017-12-28 23:08:09','2017-12-28 23:08:09'),(169,4,104,'Decent poke spot. Clean and about $7-8 a bowl. In a really cool building with small boutique shops everywhere.',NULL,NULL,'2017-12-29 04:37:59','2017-12-29 04:37:59'),(170,4,257,'Very cool spot for coffee because they turned into a boutique shopping and food and coffee experience. I buy clothes here although its on the pricier end. The food is pretty good too.',NULL,NULL,'2017-12-29 04:39:52','2017-12-29 04:39:52'),(171,1,109,'cafe  y ngon lm',NULL,NULL,'2017-12-29 15:02:50','2017-12-29 15:02:50'),(172,4,259,'Recommended by friends',NULL,NULL,'2017-12-29 16:59:00','2017-12-29 16:59:00'),(173,4,262,'Good spot for food and drinks in capital hill. We went on tequila Tuesday and the tequila was half off and the energy was great!',NULL,NULL,'2017-12-29 18:48:08','2017-12-29 18:48:08'),(174,4,263,'One of a few main clubs in Seattle, probably the best built. Music is more trap and hip hop and often they have famous artists come to town. Bottle service and a table is recommended although its easy to just do drinks at the bar and roam around. I djd here a couple times and it was one of the best experiences of my life.',NULL,NULL,'2017-12-29 18:51:15','2017-12-29 18:51:15'),(175,4,264,'One of the few night club spots in Seattle, its the main one for edm. They have famous DJs almost every weekend. One of my go tos although small like Seattle. Dont expect a big club.',NULL,NULL,'2017-12-29 18:52:40','2017-12-29 18:52:40'),(176,4,268,'Bookmarked because dash Berlin performed here at nye 2017-18',NULL,NULL,'2018-01-01 04:34:23','2018-01-01 04:34:23'),(177,4,252,'I had both the beef ribeye and the bison ribeye. The beef was tastier while the bison was leaner. Cool build out and ambiance although Greenwood area is a bit out there.',NULL,NULL,'2018-01-01 04:36:53','2018-01-01 04:36:53'),(178,4,265,'A staple in Seattle for oysters. It\'s a bit touristy but they have a huge selection of oysters and fun for happy hour.',NULL,NULL,'2018-01-01 04:38:20','2018-0