-01-11 10:22:07'),(263,24,354,'#5 of 234 Shopping in Hanoi on Trip Advisor',NULL,NULL,'2018-01-11 10:22:41','2018-01-11 10:22:41'),(264,2,104,'One of the few poke places in VN. Not bad if you\'re looking for something healthy and fast.',NULL,NULL,'2018-01-11 11:06:15','2018-01-11 11:06:15'),(265,2,105,'If you\'re looking for Poke in Saigon, look no further. This is the spot!',NULL,NULL,'2018-01-12 06:41:22','2018-01-12 06:41:22'),(266,4,105,'This is so far the best poke. They premarinate the poke so its better than poke Saigon imho. Although the portions of fish are small, about half the size of the US.',NULL,NULL,'2018-01-13 01:46:59','2018-01-13 01:46:59'),(267,24,359,'Great hotel in a great spot. The pub below is fun and it\'s surrounded by great retail and places to go out and eat. The gym is decent. The rooms are a little small, esp for the price, but that\'s expected for NYC.',NULL,'2018-01-13 04:59:13','2018-01-13 04:44:13','2018-01-13 04:59:13'),(268,24,360,'Really small rooms and the location isn\'t all that great, but I got a decent deal with points :)',NULL,NULL,'2018-01-13 04:45:27','2018-01-13 04:45:27'),(269,24,361,'The chicken is a little overhyped, but I\'d still eat here because I love fried chicken!',NULL,'2018-01-13 04:58:40','2018-01-13 04:58:28','2018-01-13 04:58:40'),(270,28,362,'You put up with the abuse for this glorious steaming bowl of rice noodles with spicy chiles, a rich hearty, porky broth with pig knuckle and snout. Its the only item on the menu and its good.',NULL,NULL,'2018-01-13 09:31:53','2018-01-13 09:31:53'),(271,28,363,'At the start of the episode, Bourdain was some soup with snails, fresh herbs, tomatoes, noodles, and broth. Youll find all kinds of soup in Vietnam, Pho being the most classic, but this one is indeed special, with more flavor (plus snails!) than your usual soup fare. Get there in the morning, we stopped by in the afternoon and she had already packed up her operation.',NULL,NULL,'2018-01-13 09:33:26','2018-01-13 09:33:26'),(272,28,365,'These mushroom and pork rice pancakes are a slippery treat that looks kind of gross, but tastes super good. You can get them all over Hanoi (the scene was shot here because the woman he dines with during the episode lives across the street), but the family that owns this place is unbelievably sweet.',NULL,NULL,'2018-01-13 09:35:08','2018-01-13 09:35:08'),(273,28,366,'Basically, this place is for cheap beer. You can also order food here, but the main draw of places like this one is the price of the pints: about 50 cents. Prepare to see a lot of drunk Vietnamese people.',NULL,NULL,'2018-01-13 09:36:00','2018-01-13 09:36:00'),(274,28,367,'This is the famed spot where Obama and Bourdain ate, and it will be quite obvious that youre in the right place based on the plethora of posters touting his visit. I feel quite certain they picked this spot because of the size (I assume Obamas level of security requires larger spaces), so while it was certainly not the best bun cha we had, it was good. Bun cha is basically a bowl of pork patty and porkbelly soup accompanied by rice noodles which you mix together with herbs in a fish, sugar, and vinegar sauce. Almost like a deconstructed pork meatball pho. This is a Vietnamese specialty I had never tried before coming here, and DAMMMMN, it is delicious. If you do want to check this place out, skip the Obama special  basically an upgrade with crab rolls, which arent particularly good. Just go classic bun cha, with of course, a beer.',NULL,NULL,'2018-01-13 09:36:58','2018-01-13 09:36:58'),(275,28,92,'The Ben Than market early in the morning. No better way to tap the pulse of a place - and the food stalls are a paradise.',NULL,NULL,'2018-01-13 09:46:01','2018-01-13 09:46:01'),(276,28,370,'Stay in a good room at the Majestic, or the more downscale but history-soaked Continental.',NULL,NULL,'2018-01-13 09:46:50','2018-01-13 09:46:50'),(277,28,371,'Stay in a good room at the Majestic, or the more downscale but history-soaked Continental.',NULL,NULL,'2018-01-13 09:47:18','2018-01-13 09:47:18'),(278,28,258,'The Trung Nguyen chain of coffee shops is also excellent. I suggest trying the \"fox\" coffee which has been \"processed\" by passing through a fox or weasel before roasting.',NULL,NULL,'2018-01-13 09:47:57','2018-01-13 09:47:57'),(279,28,372,'Com Nieu Sai Gon (6C Tu Xuong, District 3), a restaurant run by the impressive Madame Ngoc, is my favourite place in town. Everything is good - and travellers who\'ve followed up on my recommendation to eat there never return unsatisfied. They specialise in clay-pot-baked rice which, after shattering the crockery, they spin, sizzling hot, through the air over the heads of the customers then dress with sauce and scallions. Always my best meal in Saigon. Just order \"everything\" and eat yourself silly.',NULL,NULL,'2018-01-13 09:48:49','2018-01-13 09:48:49'),(280,28,305,'I drink silly novelty drinks at the ludicrously overdecorated rooftop bar of the Rex Hotel.',NULL,NULL,'2018-01-13 09:49:54','2018-01-13 09:49:54'),(281,28,374,'I also have a soft spot for the Chateau Marmont in Los Angeles, which is probably my favorite in the world.',NULL,NULL,'2018-01-13 09:54:56','2018-01-13 09:54:56'),(282,2,375,'The best hotel in Tay Ninh city. There aren\'t many options but not a bad place to stay.',NULL,NULL,'2018-01-13 13:36:12','2018-01-13 13:36:12'),(283,3,375,'khch sn  y gi ok khng anh minh\nFhg\n\nHhh',NULL,NULL,'2018-01-13 13:38:21','2018-01-14 13:29:51'),(284,2,376,'The only reason I recommend this place is there\'s really nothing else to do in Tay Ninh other than to go visit here. You can ride the tram up to the mountain top and visit the temple sitting on top of the mountain. When I was there, the temple was still under construction and so it was a bit messy.',NULL,NULL,'2018-01-13 14:06:59','2018-01-14 13:29:57'),(285,4,378,'The chicken and the squid are pretty good. Cheap local spot. Karaoke goes around which is a little loud though!',NULL,NULL,'2018-01-14 14:48:09','2018-01-14 14:48:09'),(286,4,379,'Not a huge fan of California fitness as its cramped and relatively expensive ($40-60/mth). Probably the biggest chain though in Vietnam. I prefer elite fitness which is slightly more expensive.',NULL,NULL,'2018-01-14 14:51:16','2018-01-14 14:51:16'),(287,3,378,' ',NULL,NULL,'2018-01-14 15:14:58','2018-01-14 15:14:58'),(288,4,380,'I haven\'t stayed here, but it\'s a great place to grab coffee and check out the view.',NULL,NULL,'2018-01-15 04:18:51','2018-01-15 04:18:51'),(289,4,381,'Nice hotel resort on the main area. Very spa like spot, although a bit pricey for what I think you get. I\'d prefer the intercontinental for a hotel or the Six Senses for the a resort.',NULL,NULL,'2018-01-15 04:22:23','2018-01-15 04:22:23'),(290,4,382,'Super affordable hotel and only a block walk to the beach, but not as nice as the liberty central in HCMC so I expected a nicer spot. The gym and pool are tiny. Probably won\'t stay here again.',NULL,NULL,'2018-01-15 04:23:27','2018-01-15 05:10:12'),(291,4,383,'The nicest hotel and brunch I\'ve ever stayed at - and I\'ve lived in hotels for 4 years of my life.  Had my own private butler, pool, two huts, outdoor shower...this place is unbelievable. Pricey though so once in a lifetime for me. The brunch was out of this world, all you can eat lobster and crab. The crab was alive crawling on the plate. And the honey was straight off the honeycomb. One day I\'ll come back here when I sell my company!',NULL,NULL,'2018-01-15 04:25:36','2018-01-15 04:25:36'),(292,4,186,'This more commonly known as monkey island. It is cool to see and hang out. It takes a 20 min ride to the boat terminal and then a 20 min boat ride. The monkeys can be a little aggressive so I would be careful with kids. Make sure you don\'t carry food in your backpack either!',NULL,NULL,'2018-01-15 04:32:46','2018-01-15 04:32:46'),(293,4,384,'I\'ve heard good things, but it takes a tram to get to so if you prefer city life in the beach town vs. resort, I wouldn\'t recommend.',NULL,NULL,'2018-01-15 04:34:39','2018-01-15 04:34:39'),(294,4,385,'Cute rooftop place to eat. The pasta was good and a nice change of pace from the Vietnamese food.',NULL,NULL,'2018-01-15 04:36:54','2018-01-15 04:36:54'),(295,4,386,'Great wondering around the town and checking out the shops and cafes. Although I recommend at night better as during the day it is hot hot!',NULL,NULL,'2018-01-15 04:57:24','2018-01-15 04:57:24'),(296,4,387,'The famous bridge. Just something you check out as you explore the town.',NULL,NULL,'2018-01-15 04:58:19','2018-01-15 04:58:19'),(297,4,388,'Just a really cool spot for drinks. They have a projector that shows movies in the street.',NULL,NULL,'2018-01-15 05:01:23','2018-01-15 05:01:23'),(298,4,389,'The river isn\'t very clean and the food wasn\'t that good, but it was nice to see such a famous river, especially when it came to the war.',NULL,NULL,'2018-01-15 05:05:41','2018-01-15 05:05:41'),(299,4,390,'Supposedly this place has a lot of history, but I\'m not into older traditional hotels. Too many bugs at night :(',NULL,NULL,'2018-01-15 05:07:07','2018-01-15 05:07:07'),(300,4,391,'I\'m always a fan of SPG hotels. This has a good location on the strip so easy access to the beach.  Not a bad price point either.',NULL,NULL,'2018-01-15 05:08:58','2018-01-15 05:08:58'),(301,4,392,'Sushi spot on top of AB tower so you have the view of Ho Chi Minh City. Really nice build out and very popular for events.  The sushi is more mainstream, less traditional Japanese but still good.',NULL,NULL,'2018-01-15 05:28:54','2018-01-15 05:28:54'),(302,4,393,'I\'m not sure if this was the company I used, but I did a food tour on the back of motorcycles with my friends. It was a great way to see the city, some temples, and try some food. Usually not a fan of tours, but this was fun on a motorcycle.',NULL,NULL,'2018-01-15 05:33:13','2018-01-15 05:33:13'),(303,4,394,'I airbnbed here for a week. Nice place as long as the people who furnished the apartment, super convenient to downtown (5 min ride). The gym is free and nice and the pool is decent on the rooftop. Ubers and grabs sometimes take a little while for pickup / drop off because the one-ways and bridges are bit confusing and Vietnam drivers aren\'t great with maps and directions.',NULL,NULL,'2018-01-15 05:47:19','2018-01-15 05:50:33'),(304,4,395,'Nice apartment with probably the best pool in HCMC. Far from downtown so only stay here if you\'re looking to stay in HCMC longer-term vs. just visiting.',NULL,NULL,'2018-01-15 05:48:15','2018-01-15 05:48:15'),(305,4,25,'Where I and randomly all my friends live. The location is great as it\'s 8 min to downtown, but far enough away to not live in the crazy of D1. The pool is great and you can eat and drink at it with the cafe right there. Cheap place to airbnb, but just like all airbnbs, can be hit and miss depending on who furnished it.',NULL,NULL,'2018-01-15 05:49:49','2018-01-15 05:49:49'),(306,4,396,'Very popular spot among expats but I stayed at a place that the furniture wasn\'t very nice. The gym is great, but costs money. It\'s farther out than City Garden, about 12 min from downtown.',NULL,NULL,'2018-01-15 05:52:40','2018-01-15 05:52:40'),(307,4,397,'Good quality Japanese food. The sushi is solid and the teriyaki is pretty good too. All for $10. My fave was the yogurt dessert...must try!',NULL,NULL,'2018-01-15 06:42:47','2018-01-15 06:42:47'),(308,4,398,'Something to see once.',NULL,NULL,'2018-01-15 07:09:19','2018-01-15 07:09:19'),(309,4,399,'Great to walk around and explore.',NULL,NULL,'2018-01-15 07:09:48','2018-01-15 07:09:48'),(310,4,400,'Great steak, classic experience near the river in Chicago.',NULL,NULL,'2018-01-15 07:11:34','2018-01-15 07:11:34'),(311,4,10,'New York style chill bar. Fun to hang out and pre funk before going out. Live band on Thursdays and Saturdays and a DJ on Tuesdays. Love the shisha and balloons.',NULL,NULL,'2018-01-15 07:24:33','2018-01-15 07:24:33'),(312,28,403,'Lebanese, Australian type food. He loved the lamb brains, soft shell prawns, grilled bbq quail and bbq lamb. He called it \"walk across glass\" to get it good.',NULL,NULL,'2018-01-15 07:59:52','2018-01-15 07:59:52'),(313,4,412,'The pool looks pretty cool and a great place to party.',NULL,'2018-01-15 08:04:50','2018-01-15 08:04:30','2018-01-15 08:04:50'),(314,4,412,'Great location, walking distance to all the bars. The rooftop pool looks fun too.',NULL,NULL,'2018-01-15 08:05:54','2018-01-15 08:05:54'),(315,28,413,'Used to be the chef here!',NULL,NULL,'2018-01-16 09:26:03','2018-01-16 09:26:03'),(316,28,137,'Chances are, the first thing Im doing when I get back if Ive been away for 12 daysIm exhausted, Ive flown from Japan or South America and I arrive at my apartment and Im just destroyedIm calling Seamless to get me some Shake Shack.\n\nIm having a double cheeseburger naked, please. No lettuce. No tomato. No nothing. Just cheese and two burgers on a potato bun. Ill have two of those and Im happy. Im singing America, fuck yeah!',NULL,NULL,'2018-01-16 09:27:02','2018-01-16 09:31:17'),(317,28,414,'Lets say Ive been away a long time eating perfectly good food in another country, but Im not in New York. Im going right to Russ & Daughters. Im going to beast some Russ & Daughters.\n\nIm going to get bialys and a pile of chopped liver and smoked salmon and some cream cheese, maybe some sturgeon, and maybe some fish eggs--and Im just going to go berserk.',NULL,NULL,'2018-01-16 09:27:51','2018-01-16 09:27:51'),(318,28,415,'For fun, Im going to Mission Chinese. Its the most fun restaurant in New York. The food is just delicious. It doesnt take itself too seriously. Its super low impact.\n\nAt Mission Chinese I drink cocktails with food. My judgment is destroyed by the time the appetizers arrive there. They do these lethal drinks that you would never in your right mind drink in any other circumstance. Mai Tais, really? Why not?',NULL,NULL,'2018-01-16 09:28:24','2018-01-16 09:28:24'),(319,28,416,'Ill go to Morini for a bowl of pasta, or if I really want to blow it out Ill go to Marea, but just for the pasta. Not that the fish isnt magnificent, but Ill go in and eat three or four different pastas. If I am carb-loading that would be a good choice.',NULL,NULL,'2018-01-16 09:29:36','2018-01-16 09:29:36'),(320,4,417,'I was able to work out at this gym for a 3 day membership. Really nice gym, definitely high end membership.',NULL,NULL,'2018-01-17 16:28:47','2018-01-17 16:28:47'),(321,2,418,'A great udon and soba place on the outskirts of Kobe.',NULL,NULL,'2018-01-18 02:29:32','2018-01-18 02:29:32'),(322,3,421,'p qu..',NULL,NULL,'2018-01-18 03:55:36','2018-01-18 03:55:36'),(323,4,427,'For a $1.50, you can get a really good banh mi sandwich. The bread was a nice crispy soft and it comes with pate.',NULL,NULL,'2018-01-20 14:11:15','2018-01-20 14:11:15'),(324,2,428,'This place is the bomb. If I had my last meal tomorrow, it might just be here. \nThe steak is pure ecstasy but my favorite is the beef sushi. The meat just melts in your mouth.',NULL,NULL,'2018-01-21 09:34:46','2018-01-21 09:34:46'),(325,4,429,'Asya says this her favorite area. Because its still hidden and the restaurants are really good.',NULL,NULL,'2018-01-21 13:37:21','2018-01-21 13:37:21'),(326,4,430,'Love this area. Clean, cute shops and cafes. Seems like a good energy.',NULL,NULL,'2018-01-21 13:39:31','2018-01-21 13:39:31'),(327,4,258,'This is the spot where they have the weasel coffee. They are able to sniff out the best coffee beans, and they poop them out unable to digest them. People collect them and voila weasel coffee is born. But its expensive coffee for Vietnam!',NULL,NULL,'2018-01-22 10:26:27','2018-01-22 10:26:27'),(328,4,432,'Where I and randomly all my friends live. The location is great as it\'s 8 min to downtown, but far enough away to not live in the crazy of D1. The pool is great and you can eat and drink at it with the cafe right there. Cheap place to airbnb, but just like all airbnbs, can be hit and miss depending on who furnished it.',NULL,NULL,'2018-01-24 05:15:22','2018-01-24 05:15:22'),(329,4,201,'Something to check out at least once if youve never been. Grab a drink at one of the local bars or get a spot at Sanchos for some Mexican food. Sit outside and watch the backpacking world walk by. You can party here until 6am.',NULL,NULL,'2018-01-24 11:46:20','2018-01-24 11:46:20'),(330,4,433,'Open late until 6am. One of the few after hours spots. If youre here at 4am youre already in trouble. Cant expect much other than some pros and the late night partiers who found this as the last hurrah for the night.',NULL,NULL,'2018-01-24 11:47:51','2018-01-24 11:47:51'),(331,4,28,'The food is higher end thai food that\'s not bad, but you\'re paying for the cool ambiance. I recommend eating outside - it\'s like a nice lounge. To access it, you have to go through the hotel entrance and use their elevator.',NULL,NULL,'2018-01-24 11:58:31','2018-01-24 11:58:31'),(332,4,442,'The wagyu katsu sandwich',NULL,NULL,'2018-01-25 19:05:46','2018-01-25 19:05:46'),(333,2,440,'Great if you like oysters. They have all kinds of different types; even have there own oyster farm.',NULL,NULL,'2018-01-26 07:37:34','2018-01-26 07:37:34'),(334,2,173,'The brunch is amazing!!! Best creole I\'ve ever had!!!',NULL,NULL,'2018-01-26 07:38:26','2018-01-26 07:38:26'),(335,2,8,'Really really good Asian seafood fusion. It\'s amazing!',NULL,NULL,'2018-01-26 07:39:21','2018-01-26 07:39:21'),(336,2,256,'Great place if you want good cocktails and one of the best views of the Seattle bay.',NULL,NULL,'2018-01-27 05:28:59','2018-01-27 05:28:59'),(337,2,444,'If you like good drinks and decent Americanized Mexican food this is your place.',NULL,NULL,'2018-01-27 05:30:45','2018-01-27 05:30:45'),(338,2,445,'Not really authentic and a bit on the pricy side. Only white people too. But the food isn\'t too bad.',NULL,NULL,'2018-01-27 05:32:34','2018-01-27 05:32:34'),(339,4,448,'Tim says this is the best noodles in town',NULL,NULL,'2018-01-28 04:53:16','2018-01-28 04:53:16'),(340,28,440,'Fried smelts, oysters and Dungeness crab',NULL,NULL,'2018-01-29 04:36:17','2018-01-29 04:36:17'),(341,28,454,'Fish and chips',NULL,NULL,'2018-01-29 04:36:53','2018-01-29 04:36:53'),(342,28,273,'pork belly-kimchi pancakes, short-rib dumplings, the short-rib rice bowl and noodles with flat-iron steak',NULL,NULL,'2018-01-29 04:39:59','2018-01-29 04:39:59'),(343,2,458,'First time having Balkan food and was truly delighted. \n\nI had lunch but I heard dinner is even better. They serve you 40 tapas so make sure you\'re hungry!',NULL,NULL,'2018-01-29 21:26:54','2018-01-29 21:26:54'),(344,4,257,'Just had the roast beef sandwich. Really good!',NULL,NULL,'2018-02-03 06:58:59','2018-02-03 06:58:59'),(345,4,7,'Highland\'s coffee is one of the biggest chains in Vietnam. It\'s pretty cheap, but nothing too special about it. The cafe sua da is super strong.',NULL,NULL,'2018-02-06 10:49:32','2018-02-06 10:49:32'),(346,4,95,'The banh bot lot isnt bad. Its the version that doesnt come wrapped in banana leaf which is my preferred and hard to find...except at this chain!',NULL,NULL,'2018-02-09 13:58:48','2018-02-09 13:58:48'),(347,4,461,'Not bad chicken teriyaki bento box. Super cheap - $4. But nigiri was a bit dry.',NULL,NULL,'2018-02-09 13:59:56','2018-02-09 13:59:56'),(348,2,462,'This has to be in my top five list for highest value to price. It\'s 500 yen for a teishoku meal and one of the best I\'ve ever had.',NULL,NULL,'2018-02-14 00:49:09','2018-02-14 00:49:09'),(349,2,464,'I took the family for one day getaway. The rooms are large for a Japanese hotel and very clean. The onsen was also really nice. What you would expect for a four star hotel.',NULL,NULL,'2018-02-14 07:56:08','2018-02-14 07:56:08'),(350,2,463,'Pretty cool open space museum. There are lots of interesting artwork. My favorite is the Picasso collection. You even have a foot bathing with natural hot spring water to dip your feet. \n\nYou\'ll enjoy the experience even if you aren\'t an art enthusiast. But beware, it can get quite windy and cold so bring a jacket.',NULL,NULL,'2018-02-14 08:01:37','2018-02-14 08:01:37'),(351,2,466,'This is the main train station. Most hotels are around the area. If you don\'t have a car, you\'ll need to take a bus or taxi. Public buses are pretty convenient.',NULL,NULL,'2018-02-16 13:04:10','2018-02-16 13:04:10'),(352,2,467,'Convenient driving range in the heart of the city. Only artificial turf but has a putting and chipping green. The food is also pretty good and relatively cheap. I used to go here, hit balls and eat dinner after work.',NULL,NULL,'2018-02-18 04:28:32','2018-02-18 04:28:32'),(353,2,470,'This tennis club Is one of the oldest in Saigon and known for hosting pro tennis events.\n\nIf you are looking for a court to rent, it\'s about $5/HR during the day and double that at night.',NULL,NULL,'2018-02-18 12:25:46','2018-02-18 12:25:46'),(354,2,177,'Solid Thai food. If you like sweets definitely try the mango sticky rice. It\'s one of my favorite desserts in Saigon.',NULL,NULL,'2018-02-19 11:57:16','2018-02-19 11:57:16'),(355,2,473,'This area is known for partying and good nightlife. It\'s near the Petronas towers.',NULL,NULL,'2018-02-20 04:49:38','2018-02-20 04:49:38'),(356,2,474,'Called the cultural heart of the citys local cuisine, Jalan Alor (ocated just behind Jalan Bukit Bintang), is basically a strip of atmospheric air-conditioned Chinese seafood restaurants, with a row of hawker stalls set up on the five-foot walkway on both sides and plastic tables and chairs spilling out onto the road. The variety of food available is amazing with barbecued meats, noodles and desserts recognised as some of the best (and cheapest) in the city.',NULL,NULL,'2018-02-20 05:21:50','2018-02-20 05:21:50'),(357,35,475,'Nice place for really local ambience (next to a wet market!), and local yummy food. There is also the famous \"curry laksa\" and also the \"chee cheong fun\" all in the same place.',NULL,NULL,'2018-02-20 05:49:05','2018-02-20 05:49:05'),(358,35,476,'Historical place in the heart of what used to be the city centre. A lot of history in the small chinese temple, must see.',NULL,NULL,'2018-02-20 05:50:39','2018-02-20 05:50:39'),(359,35,477,'Have a close look into the practice of the Hindu religion. Always busy, but get into the temple to look at the intricacies of the design.',NULL,NULL,'2018-02-20 05:51:52','2018-02-20 05:51:52'),(360,35,478,'The most popular place in town to go for all modern shopping needs. The Gardens is just next to it for higher end retail therapy.',NULL,NULL,'2018-02-20 05:53:21','2018-02-20 05:53:21'),(361,35,479,'The place to get your durian fix!',NULL,NULL,'2018-02-20 05:57:02','2018-02-20 05:57:02'),(362,35,480,'One of the better place for Hokkien mee and if you are early you can get fresh roast duck as well!',NULL,NULL,'2018-02-20 05:59:29','2018-02-20 05:59:29'),(363,35,481,'Major mall',NULL,NULL,'2018-02-20 06:01:15','2018-02-20 06:01:15'),(364,35,483,'Worth a short trip out of the city to climb the 200+ steps up to the caves',NULL,NULL,'2018-02-20 06:02:09','2018-02-20 06:02:09'),(365,2,484,'Located at the base of the 88-storey, steel-clad Petronas Twin Towers (which rise to 451.9m), the crescent-shaped Suria KLCC is more than just a shopping and dining venture. Opened in 1999, the retail and entertainment complex on the junction of Jalan Ampang and Jalan P. Ramlee houses a plethora of interesting attractions.',NULL,NULL,'2018-02-20 06:31:54','2018-02-20 06:31:54'),(366,2,488,'Changkat Bukit Bintang, widely regarded as Kuala Lumpurs definitive party venue, is easily accessible from prominent landmarks such as Pavilion KL, Starhill Gallery, and the Jalan Alor Food Street. This narrow avenue is filled with international restaurants, nightclubs with cocktails bars, and vibrant pubs with DJs spinning music, ranging from house and electro to remixed pop and hip-hop tunes. While its nightlife scene is always changing, there are a number of crowd-favourite establishments to be found here, include Pisco Bar, Havana Bar & Grill, and The Rabbit Hole.',NULL,NULL,'2018-02-23 01:51:26','2018-02-23 01:51:26'),(367,4,489,'Small shopping market with the usual Asian goods. Had some street hot pot here which was a cool and new experience.',NULL,NULL,'2018-02-24 04:37:47','2018-02-24 04:37:47'),(368,4,497,'Had the chicken in rice. Great presentation but I think street food  probably better.',NULL,NULL,'2018-02-24 08:00:15','2018-02-24 08:00:15'),(369,4,484,'A pretty nice mall with a variety of medium to high end stores. Probably a stop on everyones first time because you can also go to the top for a view. About $20 a person which you buy a ticket and than are able to go up in a group an hour or 2 later. Id recommend getting a ticket here first and then shopping.',NULL,NULL,'2018-02-24 08:11:18','2018-02-25 06:53:43'),(370,4,491,'Cool club with lots of different rooms. A bit over hyped though because its ranked 21 on DJ mags top clubs.',NULL,NULL,'2018-02-24 09:56:20','2018-02-24 09:56:20'),(371,4,479,'Crazy to see all the Durian types.',NULL,NULL,'2018-02-24 15:30:03','2018-02-24 15:30:03'),(372,4,488,'Place for pubs and drinks. Seems very expat but a bit on the sketchy side with women here. Def a spot to find pay for play.',NULL,NULL,'2018-02-24 17:44:34','2018-02-24 17:44:34'),(373,4,509,'Standard shopping market with a more arts and crafts focus.',NULL,NULL,'2018-02-25 04:37:19','2018-02-25 04:37:19'),(374,4,495,'Pretty much just like apocalypse in Saigon. A lot of middle aged to older men and the only girls here are working girls.',NULL,NULL,'2018-02-25 04:38:47','2018-02-25 04:38:47'),(375,4,499,'Definitely my favorite food experience here. You get to eat traditional Indian food on top of a banana leaf. Here you dont eat with your hands though. Really tasty.',NULL,NULL,'2018-02-25 04:40:45','2018-02-25 04:40:45'),(376,4,478,'Huge mall. The top floor is a nice modern build out. Very impressed with Kuala Lumpurs infrastructure and growth. You can get everything you need here. They have Muji, Berksha, and Topshop.',NULL,NULL,'2018-02-25 06:31:26','2018-02-25 06:31:26'),(377,2,499,'Get your fix of local Indian Malaysian cuisine here. Generous portions of food served on banana leaves that\'s very affordable. I suggest you order the mutton.',NULL,NULL,'2018-02-25 06:50:00','2018-02-25 06:53:44'),(378,4,513,'Philip recommends for French food',NULL,NULL,'2018-02-26 13:47:21','2018-02-26 13:47:21'),(379,2,97,'One of the best in Saigon but make sure you get a reservation!!!',NULL,NULL,'2018-02-28 11:57:42','2018-02-28 11:57:42'),(380,2,519,'Omakase counterbar sushi restaurant run by a Vietnamese sushi chef. There are set courses, the lowest starting at 500,000 dong. You get quite the bang for your buck. If you do go make sure you make a reservation.',NULL,NULL,'2018-03-02 13:34:51','2018-03-02 13:34:51'),(381,2,89,'Great roof top bar in the heart of Saigon',NULL,NULL,'2018-03-02 15:48:10','2018-03-02 15:48:10'),(382,4,467,'Good food and easy range time. Plus a cool view of the city at night.',NULL,NULL,'2018-03-11 11:55:57','2018-03-11 11:55:57'),(383,2,516,'One of the oldest courses from Saigon. Nice scenic course with we\'ll maintained greens.',NULL,NULL,'2018-03-21 05:50:42','2018-03-21 05:50:42'),(384,3,27,'Ok',NULL,NULL,'2018-03-22 11:12:41','2018-03-22 11:12:41');
